import React from 'react';

const Projects = () => {
    return (
        <div>
            <h1>My Projects</h1>
            <ul>
                <li>Project 1: React-based Portfolio</li>
                <li>Project 2: JavaScript Game</li>
                <li>Project 3: Backend API with Node.js</li>
            </ul>
        </div>
    );
};

export default Projects;
